import React from 'react';
import { NavLink } from 'react-router-dom';

const navigate = useNavigate();

const Navigation = () => {
    return (
        <div className="navigation">
            <NavLink to={"/"}>
                Accueil
            </NavLink>
            <NavLink to={"contact"}>
                Contact
            </NavLink>
            <button>Se connecter</button>
        </div>
    );
};

export default Navigation;
